function maximumSum(nums: number[]): number {
    let maxSum = 0;
    const map = new Map<string, number>();

    for (let num of nums) {
        let product = 1;
        for (let i = 2; i * i <= num; i++) {
            let count = 0;
            while (num % i === 0) {
                num /= i;
                count++;
            }
            if (count % 2 !== 0) product *= i;
        }
        if (num > 1) product *= num;
        const key = product.toString();
        map.set(key, (map.get(key) || 0) + num);
    }

    for (let sum of map.values()) {
        maxSum = Math.max(maxSum, sum);
    }

    return maxSum;
}
